import React from 'react'
import Image from './Components/Images/out.jpg'

const LeftDiv = () => {
    return (
        <div className='w-1/2 h-screen bg-cover bg-center align-middle ju'
        style={{
        backgroundImage: `url(${Image})`,}}>
            <div className='bg-white'>
                
            </div>
            <h4>Connect</h4>
            <h4>Connect</h4>
            <h4>Connect</h4>
        </div>
    );
};

const RightDiv = () => {
    return(
        <p>Home2</p>
    )
}
export default function App() {
    return (
        <div className='flex align-middle'>
            <LeftDiv/>
            <RightDiv/>

        </div>
    )
}
